import Navbar from './Components/Navbar/Navbar';
import Footer from './Components/Footer/Footer'
import Home from './Components/Home/Home';
import Skills from './Components/Skills/Skills';
import Proficiency from './Components/Proficiency/Proficiency.jsx';
import ExperiencesWrapper from './Components/Experiences/ExperiencesWrapper';
import { Route } from 'react-router-dom';
import Projects from './Components/Projects/Projects';
import BigProjects from './Components/BigProjects/BigProjects';
import Achievemtns from './Components/Achievements/Achievements';

function App() {
  return (
    <div>
      <Navbar />
      <Home />
      <Skills />
      <Proficiency />
      <ExperiencesWrapper />
      <Projects />
      <BigProjects />
      <Achievemtns />
    </div>
  );
}

export default App;
